  true,\n\t\"url\": null,\n\t\"notes\": \"The Emissions & Generation Resource Integrated
  Database (eGRID) is a comprehensive source of data on the environmental characteristics
  of almost all electric power generated in the United States. These environmental
  characteristics include air emissions for nitrogen oxides, sulfur dioxide, carbon
  dioxide, methane, nitrous oxide, and mercury; emissions rates; net generation; resource
  mix; and many other attributes. nneGRID2002 (years 1996 through 2000 data) contains
  16  Excel spreadsheets and the Technical Support Document, as well as the eGRID
  Data Browser, User's Manual, and Readme file.  Archived eGRID data can be viewed
  as spreadsheets or by using the eGRID Data Browser. The eGRID spreadsheets can be
  manipulated by data users and enables users to view all the data underlying eGRID.
  The eGRID Data Browser enables users to view key data using powerful search features.
  Note that the eGRID Data Browser will not run on a Mac-based machine without Windows
  emulation.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
